import React from "react";
import "../Css/Seeds.css";

function Seeds() {
  const seedsList = [
    {
      id: 1,
      name: "Tomato Seeds",
      price: 120,
      img: "https://i0.wp.com/seed2plant.in/cdn/shop/products/tomatoseeds.webp"
    },
    {
      id: 2,
      name: "Chilli Seeds",
      price: 90,
      img: "https://m.media-amazon.com/images/I/81yGwD8ukHL._AC_SL1500_.jpg"
    },
    {
      id: 3,
      name: "Groundnut Seeds",
      price: 150,
      img: "https://5.imimg.com/data5/SELLER/Default/2023/7/326550963/groundnut-seeds.jpg"
    },
    {
      id: 4,
      name: "Corn Seeds",
      price: 200,
      img: "https://m.media-amazon.com/images/I/71vZZ_-9d5L._AC_SL1500_.jpg"
    },

    // ⭐ New seeds with direct Google/CDN images
    {
      id: 5,
      name: "Carrot Seeds",
      price: 80,
      img: "https://m.media-amazon.com/images/I/71V7vC18XNLS._AC_SL1500_.jpg"
    },
    {
      id: 6,
      name: "Onion Seeds",
      price: 70,
      img: "https://m.media-amazon.com/images/I/71y6XkZmtML._AC_SL1500_.jpg"
    },
    {
      id: 7,
      name: "Cabbage Seeds",
      price: 60,
      img: "https://m.media-amazon.com/images/I/81u2iKziqvL._AC_SL1500_.jpg"
    },
    {
      id: 8,
      name: "Cauliflower Seeds",
      price: 75,
      img: "https://m.media-amazon.com/images/I/81dzxsVXniL._AC_SL1500_.jpg"
    },
    {
      id: 9,
      name: "Spinach Seeds",
      price: 50,
      img: "https://m.media-amazon.com/images/I/81uPZROPfRL._AC_SL1500_.jpg"
    },
    {
      id: 10,
      name: "Brinjal Seeds",
      price: 90,
      img: "https://m.media-amazon.com/images/I/81xxZFQ871L._AC_SL1500_.jpg"
    },
    {
      id: 11,
      name: "Okra (Lady Finger) Seeds",
      price: 85,
      img: "https://m.media-amazon.com/images/I/71+IUQB0WLL._AC_SL1500_.jpg"
    },
    {
      id: 12,
      name: "Peas Seeds",
      price: 95,
      img: "https://m.media-amazon.com/images/I/81N9ycW+HIL._AC_SL1500_.jpg"
    },
    {
      id: 13,
      name: "Pumpkin Seeds",
      price: 110,
      img: "https://m.media-amazon.com/images/I/81dcpSUgYGb._AC_SL1500_.jpg"
    },
    {
      id: 14,
      name: "Sunflower Seeds",
      price: 140,
      img: "https://m.media-amazon.com/images/I/81mAX-HJmqL._AC_SL1500_.jpg"
    },
    {
      id: 15,
      name: "Mustard Seeds",
      price: 60,
      img: "https://m.media-amazon.com/images/I/71jLBA-h4vL._AC_SL1500_.jpg"
    },
    {
      id: 16,
      name: "Wheat Seeds",
      price: 45,
      img: "https://5.imimg.com/data5/ANDROID/Default/2021/6/KL/WB/XM/4688848/product.jpg"
    },
    {
      id: 17,
      name: "Rice Paddy Seeds",
      price: 55,
      img: "https://5.imimg.com/data5/SELLER/Default/2023/8/331946784/paddy-seeds.jpg"
    },
    {
      id: 18,
      name: "Cotton Seeds",
      price: 180,
      img: "https://m.media-amazon.com/images/I/81JNPwTKNLL._AC_SL1500_.jpg"
    },
  ];

  return (
    <div className="seeds-container">
      <h2 className="seeds-title">
        <i className="fa fa-seedling"></i> Seeds Marketplace
      </h2>

      <div className="seeds-grid">
        {seedsList.map((item) => (
          <div className="seeds-card" key={item.id}>
            <img src={item.img} alt={item.name} className="seeds-img" />

            <h3 className="seeds-name">{item.name}</h3>

            <p className="seeds-price">
              <i className="fa fa-rupee-sign"></i> {item.price}
            </p>

            <button className="seeds-btn">
              <i className="fa fa-shopping-cart"></i> Buy Seeds
            </button>
          </div>
        ))}
      </div>
    </div>
  );
}

export default Seeds;
